import ReactDOM from 'react-dom';

function App() {
  const firstName = "Delu"
  const lastName = "Giurgiu"
  return (
    <h1>Helooo {`${firstName} + " " +${lastName}`}</h1>
  )
}




ReactDOM.render(<App />,document.getElementById("root"));
